function getClassNameForSeatNum(seat_num_id) {
    var className = "";

    if (seat_num_id) {
        if (seat_num_id.length > 3) {
            className = "middle";
        }

        if (seat_num_id.length > 4) {
            className = "large";
        }
    }

    return className;
}

