function CheckPwd(str, str2) {

    var result = [];
    result.message = "Parola kullanlabilir";
    result.code = 1;

    var regex_symbols = /[-!$%^&*()_+|~=`{}\[\]:\/;<>?,.@#]/;
    var frequentlyUsed = ["12345678", "1111", "picture1", "123123", "abc123", "0000", "1111", "2222", "3333", "4444", "5555", "6666", "7777", "8888", "9999", "iloveyou", "seniseviyorum", "password1", "qqww1122", "123321", "654321", "qwertyuiop", "qwer123456", "asdfghjkl", "87654321", "unknown", "zxcvbnm", "112233", "123qwe", "123abc", "1q2w3e4r", "1qaz2wsx", "aaaaaa", "1q2w3e", "passw0rd", "sanane", "parola", "gizli", "unuttum", "deneme", "bilmiyorum", "bulursun", "qweasd"];

    if (str.length < 8 || str.length > 24) {
        result.message = "Parolanz 8-24 karakter uzunluunda olmaldr!";
        result.code = -1;
        return result;
    } else if (str.search(/\d/) == -1) {
        result.message = "Parolanz en az 1 rakam iermelidir!";
        result.code = -2;
        return result;
    } else if (str.search(/[a-z]/) == -1) {
        result.message = "Parolanz en az 1 kk harf iermelidir!";
        result.code = -3;
        return result;
    } else if (str.search(/[A-Z]/) == -1) {
        result.message = "Parolanz en az 1 byk harf iermelidir!";
        result.code = -4;
        return result;
    }
    //else if (!regex_symbols.test(str)) {
    //    result.message = "Parolanz en az 1 zel karakter iermelidir!";
    //    result.code = -5;
    //    return result;
    //}
    else if (str != str2) {
        result.message = "Parolalarnz elemiyor!";
        result.code = -6;
        return result;
    }

    return result;
}



